function Movie({ name, image }) {
  return <div>
    <h2>I like {name} movies!</h2>
    <img src={image} />
  </div>;
}

const movieILike = [
  { name: "horor", image: "" },
  { name: "romance", image: "" },
  { name: "fantasy", image: "" },
  { name: "comic", image: "https://pin.it/4nIcaTA" },
  { name: "thriller", image: "https://assets.pinterest.com/ext/embed.html?id=891149844987171457" }
];

function App() {
  return (
    <div className="App">
      <h1>eeeyeah!</h1>
      {movieILike.map(genre => <Movie name={genre.name} />)}
    </div>
  );
}

export default App;
